import React, { useEffect, useState ,deleteRow } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
const Washer = () => {
    
    const [washers, setWashers] = useState([])   
    let navigate = useNavigate() 
    useEffect(() => {
        fetch("http://localhost:8081/order/allorders").then(result => {
            result.json().then(
                resp => {
                    setWashers(resp)
                })
        })
    }, [])

    // new line 
   
    

    
    return (

        <div>
            <div>
                <h1 className="bookdetails">Booked Details</h1>
            </div>

            {washers.map((emp, ind) => (
                <div className="booking" >
                    <div className='cards__wrapper'>
                        <p className="cards__container" >OrderId : {emp.orderId}</p>
                        <p className="cards__container">Name : {emp.username}</p>
                        <p className="cards__container">Car Name : {emp.carName}</p>
                        <p className="cards__container">Car Model: {emp.carModel}</p>
                        <p className="cards__container">Appointment Date : {emp.date}</p>
                        <p className="cards__container">Contact.No : {emp.contactno}</p>
                        <p className="cards__container">Address: {emp.address}</p>
                        {/* <button className="bookBtn2" >Confirm Booking</button> */}
                        {/* <button className="bookBtn1">Cancel Booking</button> */}
                        <button className=" bookBtn1 "style={{marginleft:"5px " }} onClick={() => { navigate(`/Order/${emp.orderId}`) }}>Cancel Order</button>
                    </div>
                    <hr style={{ marginTop: "30px" }} />
                </div>
            ))
            }
        </div>
    )
}

export default Washer
